class TechnologyItem extends Component {  
    
  constructor(props){
    super(props);  
    this.state = {
    itemSVG : this.convertStringToSVG(this.props.item),
    technologyName : this.convertStringtoReadableString(this.props.stringName)
  }}

  //takes the passed in string value and attempts to find a matching human readable string
  convertStringtoReadableString(stringName){
    if (stringName.toUpperCase() in techNames){
      return techNames[stringName.toUpperCase()];
    }
    else{
      console.error("Unrecognised icon name:",stringName);
      return techNames.DEFAULT;
    }
  }

  //takes the passed in string value and attempts to find the relevant SVG icon
  convertStringToSVG(itemSVG){
    if (itemSVG.toUpperCase() in techIcons){
      return techIcons[itemSVG.toUpperCase()];
    }
    else{
      return techIcons.DEFAULT;
    }
  }

  //hacky way to generate a random number
  randomnumber() {
    return Math.random() * (100000000 - 1) + 1;
  }

  render() {
    return (     
      <div className="tech-icon-container">
        <Tooltip title={this.state.technologyName} position="bottom" distance="5">
          <SVGInline className="tech-icon" svg={this.state.itemSVG} key={this.randomnumber()}/>
        </Tooltip>
      </div>
    );
  }
}
//this.props validation (only used for during dev)
TechnologyItem.propTypes = {
  item: PropTypes.string,
  stringName : PropTypes.string
}

export default TechnologyItem;
